const initialState = ({
    queries: ['dada','dadaa']
})

export const savedQueries = (state = initialState, action) => {
    switch (action.type) {
        case 'addQuery':
            return {
                ...state,
                queries: state.queries.concat(action.name)
            }
        default: return state
    }
}
